import * as React from 'react';
import { TextInput } from 'react-native-paper';

const OutlinedInputBox = () => {

  return (
    <TextInput
      label="Set Timmer"
      style = {{marginTop: '4%'}}
    />
  );
};

export default OutlinedInputBox;
